Club for Junglers who aim to learn the game and enhance their level of play. My goal is for us to have a group where we can maintain a socially friendly and accepting environment, where players can share their experiences, tips and tricks to help others climb the ladder, or to simply have fun! Add me if you&#039;re looking for an invite. See you later, summoners.

